        "title": "Every Single Lightsaber COLOR MEANING Explained (All Known 13+ Colors) [2022 UPDATED] [CANON]",
        "description": "Although having a lightsaber does not make one a Jedi, the Lightsaber is a crucial part of a Padawan‚Äôs journey towards becoming a master. Across the galaxy, the Jedi, Sith and other force wielding groups use lightsabers of a range range of colours... But what do these colours mean? Well I‚Äôm going to break down every single known lightsaber Color in Canon and exactly what they tell you about the user. So hit that Red Subscribe button to purify it and let‚Äôs get into it.\n\n#StarWars #kybercrystal #lightsaber \n\nA lightsaber blade‚Äôs colour emanates from the kyber crystal inside of it‚Äôs hilt. This is the heart of a lightsaber and it‚Äôs colour is determined the moment the user harvests it from its resting place. So in essence, a lightsaber‚Äôs color reveals something about it‚Äôs wielder and their personality. \n\nSo that leads us to **number 1. Blue Lightsabers.**\n\nBlue lightsabers are the most common seen among members of the Jedi order during the time of the Clone Wars. Blue lightsabers are used by Jedi Guardians, who prefer to focus on lightsaber combat and honing their aggressive negotiation skills. Jedi Guardians are a mirror to Sith Warriors from many millenia ago and they were seen as the Order‚Äôs representatives to the rest of the Galaxy, using combat to protect those in need. Guardians spent most of their time honing their martial arts skills and on peacekeeping missions in violent locations. Some prominent examples of Jedi Guardians are Anakin Skywalker, Count Dooku when he was still a Jedi and even Ki-Adi Mundi. \n\n**Number 2. Green Lightsabers**\n\nGreen lightsabers were usually wielded by Jedi Consulars. If a Jedi who was about to harvest his kyber crystal was more in tune with the cosmic force than the living force, he would be granted a green lightsaber crystal.",
